restrictions:
Conforme a Lei Municipal nº 1586/2007, em seu artigo 14º, o terreno objeto da concessão de uso, promessa de doação, doação ou escritura de doação, reverterá automaticamente ao Município, sem direito a indenização pelas benfeitorias, melhorias ou qualquer outro tipo de indenização, independente de qualquer ação ou notificação judicial ou extrajudicial, quando:
- a construção não for iniciada no prazo de 06 (seis) meses ou concluída no prazo de 24 (vinte e quatro) meses;
- a empresa ou indústria beneficiária permanecer por mais de 06 (seis) meses desativada ou com suas atividades paralisadas;
- a empresa ou indústria beneficiária diminuir em mais de 1/3 (um terço) pelo prazo de 02 (dois) meses ou mais, o número de empregos diretos que prometeu gerar;
- A empresa ou Indústria beneficiária, violar fraudulentamente as obrigações tributárias;
- A empresa beneficiária mudar a destinação do terreno,  implantando indústria ou empresa diferente daquela para que foi autorizada.
